static void
log_message(int priority, const char *format, va_list ap)
{
    char *message;
    int len;

    len = vasprintf(&message, format, ap);
    if (len < 0) {
        return;
    }

    if (log_fd >= 0) {
        char *priority_str = log_priority_to_str(priority);
        dprintf(log_fd, "%s: %s\n", priority_str, message);
        free(priority_str);
    }

    if (priority >= log_priority) {
        fprintf(stderr, "%s: %s\n", log_priority_to_str(priority), message);
    }

    free(message);
}

