        self.subject = subject

    def __str__(self):
        return f"{super().__str__()} - {self.subject}"


class Employee(Person):
    def __init__(self, name, age, position):
        super().__init__(name, age)
        self.position = position

    def __str__(self):
        return f"{super().__str__()} - {self.position}"


class Manager(Employee):
    def __init__(self, name, age, position, department):
        super().__init__(name, age, position)
        self.department = department

    def __str__(self):
        return f"{super().__str__()} - {self.department}"


class PersonFactory:
    def create_person(self, name, age):
        return Person(name, age)

    def create_student(self, name, age, grade):
        return Student(name, age, grade)

    def create_teacher(self, name, age, subject):
        return Teacher(name, age, subject)

    def create_employee(self, name, age, position):
        return Employee(name, age, position)

    def create_manager(self, name, age, position, department):
        return Manager(name, age, position, department)


