void RequestManager::on_timer()
{
    // Check if we have any pending requests
    if (m_pending_requests.size() > 0)
    {
        // We have pending requests, check if we have any available connections
        if (m_connections.size() > 0)
        {
            // We have available connections, send the next request
            m_pending_requests.front()->send();
        }
        else
        {
            // No available connections, start a new connection
            start_connection();
        }
    }
    else
    {
        // No pending requests, stop the timer
        m_timer.stop();
    }
}

void RequestManager::start_connection()
{
    // Create a new connection
    Connection *connection = new Connection(this);

    // Connect the signals
    connect(connection, &Connection::connected, this, &RequestManager::on_connection_connected);
    connect(connection, &Connection::disconnected, this, &RequestManager::on_connection_disconnected);
    connect(connection, &Connection::request_finished, this, &RequestManager::on_request_finished);

    // Add the connection to the list of connections
    m_connections.push_back(connection);

    // Start the connection
    connection->start();
}

void RequestManager::on_connection_connected()
{
    // Get the connection that has connected
    Connection *connection = qobject_cast<Connection *>(sender());

    // Check if the connection is valid
    if (connection == nullptr)
    {
        // The connection is not valid, we can't do anything
        return;
    }

    // Check if we have any pending requests
    if (m_pending_requests.size() > 0)
    {
        // We have pending requests, send the next request
        m_pending_requests.front()->send();
    }
    else
    {
        // No pending requests, we can stop the timer
        m_timer.stop();
    }
}

void RequestManager::on_connection_disconnected()
{
    // Get the connection that has disconnected
    Connection *connection = qobject_cast<Connection *>(sender());

    // Check if the connection is valid
    if (connection == nullptr)
    {
        // The connection is not valid, we can't do anything
        return;
    }

    // Remove the connection from the list of connections
    m_connections.removeOne(connection);

    // Delete the connection
    delete connection;
}

void RequestManager::on_request_finished()
{
    // Get the request that has finished
    Request *request = qobject_cast<Request *>(sender());

    // Check if the request is valid
    if (request == nullptr)
    {
        // The request is not valid, we can't do anything
        return;
    }

    // Remove the request from the list of pending requests
    m_pending_requests.removeOne(request);

    // Check if we have any pending requests
    if (m_pending_requests.size() > 0)
    {
        // We have pending requests, send the next request
        m_pending_requests.front()->send();
    }
    else
    {
        // No pending requests, stop the timer
        m_timer.stop();
    }
}

