    printf("%02d:%02d:%02d %s %s %02d %s %d\n",
           tm->tm_hour, tm->tm_min, tm->tm_sec,
           get_day_of_week_name(tm->tm_wday),
           get_month_name(tm->tm_mon),
           tm->tm_mday,
           get_day_of_week_name(tm->tm_wday),
           tm->tm_year + 1900);
}

