        return f"{self.name} {self.age} {self.gender}"


class Student(Person):
    def __init__(self, name, age, gender, course):
        super().__init__(name, age, gender)
        self.course = course

    def __str__(self):
        return f"{super().__str__()} {self.course}"


class Teacher(Person):
    def __init__(self, name, age, gender, subject):
        super().__init__(name, age, gender)
        self.subject = subject

    def __str__(self):
        return f"{super().__str__()} {self.subject}"


class Employee(Person):
    def __init__(self, name, age, gender, company):
        super().__init__(name, age, gender)
        self.company = company

    def __str__(self):
        return f"{super().__str__()} {self.company}"


class Manager(Employee):
    def __init__(self, name, age, gender, company, department):
        super().__init__(name, age, gender, company)
        self.department = department

    def __str__(self):
        return f"{super().__str__()} {self.department}"


class Worker(Employee):
    def __init__(self, name, age, gender, company, department, position):
        super().__init__(name, age, gender, company)
        self.department = department
        self.position = position

    def __str__(self):
        return f"{super().__str__()} {self.department} {self.position}"


class PersonFactory:
    @staticmethod
    def create_person(name, age, gender, course=None, subject=None, company=None, department=None, position=None):
        if course:
            return Student(name, age, gender, course)
        elif subject:
            return Teacher(name, age, gender, subject)
        elif company:
            if department:
                if position:
                    return Worker(name, age, gender, company, department, position)
                else:
                    return Manager(name, age, gender, company, department)
            else:
                return Employee(name, age, gender, company)
        else:
            return Person(name, age, gender)


if __name__ == '__main__':
