//////////////////////////////////////////////////////////////////////////
void CMesh::CMeshMaterial::SetTexture(const char* pTextureName, ETextureType textureType)
{
    if (!pTextureName || !pTextureName[0])
    {
        return;
    }

    if (textureType == ETT_Diffuse)
    {
        if (m_pMesh->m_pMesh->m_pMaterials[m_nMaterialIndex].m_pTexture)
        {
            m_pMesh->m_pMesh->m_pMaterials[m_nMaterialIndex].m_pTexture->Release();
            m_pMesh->m_pMesh->m_pMaterials[m_nMaterialIndex].m_pTexture = NULL;
        }

        m_pMesh->m_pMesh->m_pMaterials[m_nMaterialIndex].m_pTexture = new CTexture;
        m_pMesh->m_pMesh->m_pMaterials[m_nMaterialIndex].m_pTexture->m_pTexture = NULL;
        m_pMesh->m_pMesh->m_pMaterials[m_nMaterialIndex].m_pTexture->m_pTextureName = new char[strlen(pTextureName) + 1];
        strcpy(m_pMesh->m_pMesh->m_pMaterials[m_nMaterialIndex].m_pTexture->m_pTextureName, pTextureName);
    }
    else if (textureType == ETT_Specular)
    {
        if (m_pMesh->m_pMesh->m_pMaterials[m_nMaterialIndex].m_pSpecularTexture)
        {
            m_pMesh->m_pMesh->m_pMaterials[m_nMaterialIndex].m_pSpecularTexture->Release();
            m_pMesh->m_pMesh->m_pMaterials[m_nMaterialIndex].m_pSpecularTexture = NULL;
        }

        m_pMesh->m_pMesh->m_pMaterials[m_nMaterialIndex].m_pSpecularTexture = new CTexture;
        m_pMesh->m_pMesh->m_pMaterials[m_nMaterialIndex].m_pSpecularTexture->m_pTexture = NULL;
        m_pMesh->m_pMesh->m_pMaterials[m_nMaterialIndex].m_pSpecularTexture->m_pTextureName = new char[strlen(pTextureName) + 1];
        strcpy(m_pMesh->m_pMesh->m_pMaterials[m_nMaterialIndex].m_pSpecularTexture->m_pTextureName, pTextureName);
    }
}

