    """

    def __init__(self, file_path):
        self.file_path = file_path
        self.lines = []
        self.line_count = 0

    def __str__(self):
        return "File: {}".format(self.file_path)

    def __repr__(self):
        return self.__str__()

    def read_file(self):
        """
        Reads the file into memory.
        """
        with open(self.file_path, "r") as file:
            for line_number, line_text in enumerate(file):
                self.lines.append(Line(line_number, line_text))
                self.line_count += 1

    def write_file(self, new_lines):
        """
        Writes the file to disk.
        """
        with open(self.file_path, "w") as file:
            for line in new_lines:
                file.write(line)

    def get_line(self, line_number):
        """
        Returns the line at the specified line number.
        """
        if line_number < 0 or line_number >= self.line_count:
            raise IndexError("Line number out of range.")
        return self.lines[line_number]

    def get_lines(self):
        """
        Returns all the lines in the file.
        """
        return self.lines

    def get_line_count(self):
        """
        Returns the number of lines in the file.
        """
        return self.line_count

    def get_file_path(self):
        """
        Returns the path to the file.
        """
        return self.file_path

