"""
    A class to represent a single row in the database.
    """

    def __init__(self, row):
        self.row = row

    def __getitem__(self, key):
        return self.row[key]

    def __setitem__(self, key, value):
        self.row[key] = value

    def __delitem__(self, key):
        del self.row[key]

    def __contains__(self, key):
        return key in self.row

    def __iter__(self):
        return iter(self.row)

    def __len__(self):
        return len(self.row)

    def __repr__(self):
        return repr(self.row)

    def __str__(self):
        return str(self.row)

    def __unicode__(self):
        return unicode(self.row)

    def __nonzero__(self):
        return bool(self.row)

    def __eq__(self, other):
        return self.row == other

    def __ne__(self, other):
        return self.row != other

    def __hash__(self):
        return hash(self.row)

    def __getattr__(self, key):
        try:
            return self.row[key]
        except KeyError:
            raise AttributeError(key)

    def __setattr__(self, key, value):
        self.row[key] = value

    def __delattr__(self, key):
        del self.row[key]

    def __getstate__(self):
        return self.row

    def __setstate__(self, state):
        self.row = state

    def __copy__(self):
        return self.__class__(self.row)

    def __deepcopy__(self, memo):
        return self.__class__(copy.deepcopy(self.row, memo))

    def __reduce__(self):
        return self.__class__, (self.row,)

    def __reduce_ex__(self, protocol):
        return self.__reduce__()

    def __getnewargs__(self):
        return (self.row,)

