bool CPDF_Stream::WriteTo(IFX_ArchiveStream* archive) {
  if (!archive)
    return false;

  if (!archive->WriteString("stream\r\n"))
    return false;

  if (!archive->WriteBlock(m_pData, m_nSize))
    return false;

  if (!archive->WriteString("\r\nendstream"))
    return false;

  return true;
}

CPDF_Stream* CPDF_Stream::Clone() const {
  return new CPDF_Stream(m_pDict->Clone(), m_pData, m_nSize);
}

CPDF_StreamAcc::CPDF_StreamAcc()
    : m_pStream(nullptr), m_pData(nullptr), m_nSize(0) {}

CPDF_StreamAcc::~CPDF_StreamAcc() {
  FX_Free(m_pData);
}

void CPDF_StreamAcc::LoadAllData(bool bRawData, bool bImageAcc) {
  if (m_pStream->GetRawSize() > 0) {
    m_pData = FX_Alloc(uint8_t, m_pStream->GetRawSize());
    m_nSize = m_pStream->GetRawSize();
    m_pStream->GetRawData(m_pData, m_nSize);
    return;
  }
  m_pData = nullptr;
  m_nSize = 0;
  if (bRawData) {
    m_pData = FX_Alloc(uint8_t, m_pStream->GetSize());
    m_nSize = m_pStream->GetSize();
    m_pStream->GetAllData(m_pData, m_nSize);
    return;
  }
  if (bImageAcc) {
    m_pData = FX_Alloc(uint8_t, m_pStream->GetSize());
    m_nSize = m_pStream->GetSize();
    m_pStream->GetImageData(m_pData, m_nSize);
    return;
  }
  m_pData = FX_Alloc(uint8_t, m_pStream->GetSize());
  m_nSize = m_pStream->GetSize();
  m_pStream->GetData(m_pData, m_nSize);
}

CPDF_Stream* CPDF_StreamAcc::DetachStream() {
  CPDF_Stream* pStream = m_pStream;
  m_pStream = nullptr;
  return pStream;
}

CPDF_Stream* CPDF_StreamAcc::Clone() const {
  return new CPDF_StreamAcc(m_pStream->Clone());
}

CPDF_StreamAcc::CPDF_StreamAcc(CPDF_Stream* pStream) {
  m_pStream = pStream;
  LoadAllData(false, false);
}

