bool is_valid_ipv4_address(const std::string& ip)
{
    if (ip.empty())
        return false;

    std::vector<std::string> parts;
    boost::split(parts, ip, boost::is_any_of("."));
    if (parts.size() != 4)
        return false;

    for (auto& part : parts)
    {
        if (part.empty())
            return false;

        int num = 0;
        if (!boost::conversion::try_lexical_convert(part, num))
            return false;

        if (num < 0 || num > 255)
            return false;
    }

    return true;
}

bool is_valid_ipv6_address(const std::string& ip)
{
    if (ip.empty())
        return false;

    std::vector<std::string> parts;
    boost::split(parts, ip, boost::is_any_of(":"));
    if (parts.size() != 8)
        return false;

    for (auto& part : parts)
    {
        if (part.empty())
            return false;

        int num = 0;
        if (!boost::conversion::try_lexical_convert(part, num))
            return false;

        if (num < 0 || num > 65535)
            return false;
    }

    return true;
}

