  methods: {
    getList() {
      this.loading = true
      const params = {
        current: this.page.current,
        size: this.page.size
      }
      getList(params).then(res => {
        this.tableData = res.data.records
        this.page.total = res.data.total
        this.loading = false
      })
    },
    handleSizeChange(val) {
      this.page.size = val
      this.getList()
    },
    handleCurrentChange(val) {
      this.page.current = val
      this.getList()
    },
    pass(id) {
      this.$confirm('确定通过该申请吗？', '提示', {
        confirmButtonText: '确定',
        cancelButtonText: '取消',
        type: 'warning'
      }).then(() => {
        pass(id).then(res => {
          this.$message({
            type: 'success',
            message: '操作成功'
          })
          this.getList()
        })
      })
    },
    reject(id) {
      this.$prompt('请输入拒绝原因', '提示', {
        confirmButtonText: '确定',
        cancelButtonText: '取消',
        inputPattern: /^[\s\S]*.*[^\s][\s\S]*$/,
        inputErrorMessage: '请输入拒绝原因'
      }).then(({ value }) => {
        reject({ id, reason: value }).then(res => {
          this.$message({
            type: 'success',
            message: '操作成功'
          })
          this.getList()
        })
      }).catch(() => {
        this.$message({
          type: 'info',
          message: '取消输入'
        })
      })
    }
  }
