def find_max_value(tree):
    """
    Find the maximum value in a binary tree.
    """
    if tree is None:
        return None

    if tree.right is None:
        return tree.value

    return find_max_value(tree.right)


def find_min_value(tree):
    """
    Find the minimum value in a binary tree.
    """
    if tree is None:
        return None

    if tree.left is None:
        return tree.value

    return find_min_value(tree.left)


def find_successor(tree, value):
    """
    Find the successor of a given value in a binary tree.
    """
    if tree is None:
        return None

    if tree.value == value:
        if tree.right is not None:
            return find_min_value(tree.right)
        else:
            return None

    if tree.value > value:
        return find_successor(tree.left, value)
    else:
        return find_successor(tree.right, value)


def find_predecessor(tree, value):
    """
    Find the predecessor of a given value in a binary tree.
    """
    if tree is None:
        return None

    if tree.value == value:
        if tree.left is not None:
            return find_max_value(tree.left)
        else:
            return None

    if tree.value < value:
        return find_predecessor(tree.right, value)
    else:
        return find_predecessor(tree.left, value)


def find_closest_value(tree, value):
    """
    Find the closest value to a given value in a binary tree.
    """
    if tree is None:
        return None

    if abs(tree.value - value) < abs(find_closest_value(tree.left, value) - value):
        return tree.value
    else:
        return find_closest_value(tree.right, value)


def find_closest_value_recursive(tree, value):
    """
    Find the closest value to a given value in a binary tree using recursion.
    """
    if tree is None:
        return None

    if abs(tree.value - value) < abs(find_closest_value_recursive(tree.left, value) - value):
        return tree.value
    else:
        return find_closest_value_recursive(tree.right, value)


